import React from 'react'


class MyComponent extends React.Component {
	handleClick() {
	this.setState({
		foo: 'bar'
	});
	console.log('click');
}

 render() {
  return (
   <button onClick={this.handleClick}>
   	click me
   </button>
  );
 }
}

export default MyComponent;
